data.value:
Проверка на неравенство перед присваиванием избыточна
<pre>
  if (x != value)
    x = value;
</pre>

Преобразовать следующий код:
<pre>
  if (condition) x = expr1;
  else x = expr2;
</pre>
в:
<pre>
  x = condition ? expr1 : expr2;
</pre>

Преобразовать следующий код:
<pre>
  var x = expr1;
  if (x == null) x = expr2;
</pre>
в:
<pre>
  var x = expr1 ?? expr2;
</pre>

Предлагается заменить
            bool result = x > 0;
            if (y > 0) result = true;
            на
            bool result = x > 0 || y > 0;

Преобразовать следующий код:
<pre>
  if (condition) return expr1;
  return expr2;
</pre>
в:
<pre>
  return condition ? expr1 : expr2;
</pre>

Избыточная ветвь default switch:
<pre>
  switch (foo)
  {
    case Bar:
      DoSomething;
      break;
    default: // здесь
      break;
  }
</pre>
